-- ----------------------------
-- Table structure for oauth_access_token
-- ----------------------------
DROP TABLE IF EXISTS `oauth_access_token`;
CREATE TABLE `oauth_access_token`  (
  `token_id` varchar(255) NOT NULL COMMENT 'Token令牌id',
  `token` blob NULL COMMENT 'Token令牌',
  `authentication_id` varchar(255) NULL DEFAULT NULL COMMENT '身份认证id',
  `user_name` varchar(255) NULL DEFAULT NULL COMMENT '用户名称',
  `client_id` varchar(255) NULL DEFAULT NULL COMMENT '客户端id',
  `authentication` blob NULL COMMENT '身份认证信息',
  `refresh_token` varchar(255) NULL DEFAULT NULL COMMENT '刷新Token令牌',
  `create_time` timestamp(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  PRIMARY KEY (`token_id`),
  INDEX `token_id_index`(`token_id`),
  INDEX `authentication_id_index`(`authentication_id`),
  INDEX `user_name_index`(`user_name`),
  INDEX `client_id_index`(`client_id`),
  INDEX `refresh_token_index`(`refresh_token`)
) ENGINE = InnoDB CHARACTER SET = utf8;

-- ----------------------------
-- Records of oauth_access_token
-- ----------------------------

-- ----------------------------
-- Table structure for oauth_client_details
-- ----------------------------
DROP TABLE IF EXISTS `oauth_client_details`;
CREATE TABLE `oauth_client_details`  (
  `client_id` varchar(255) NOT NULL COMMENT '客户端id',
  `client_secret` varchar(255) NULL DEFAULT NULL COMMENT '客户端密匙',
  `resource_ids` varchar(255) NULL DEFAULT NULL COMMENT '访问资源ids',
  `scope` varchar(255) NULL DEFAULT NULL COMMENT '客户端权限范围',
  `authorized_grant_types` varchar(255) NULL DEFAULT NULL COMMENT '身份认证类型',
  `web_server_redirect_uri` varchar(255) NULL DEFAULT NULL COMMENT '认证后服务跳转地址',
  `authorities` varchar(255) NULL DEFAULT NULL COMMENT '身份认证信息',
  `access_token_validity` int(11) NULL DEFAULT NULL COMMENT '访问令牌有效性',
  `refresh_token_validity` int(11) NULL DEFAULT NULL COMMENT '刷新令牌有效性',
  `additional_information` text NULL COMMENT '令牌附加信息',
  `archived` tinyint(1) NULL DEFAULT 0 COMMENT '令牌是否存档',
  `trusted` tinyint(1) NULL DEFAULT 0 COMMENT '令牌是否可信',
  `autoapprove` varchar(255) NULL DEFAULT 'false' COMMENT '默认认证结果false/true',
  `create_time` timestamp(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  PRIMARY KEY (`client_id`)
) ENGINE = InnoDB CHARACTER SET = utf8;

